<!doctype html>
<html lang="en">

<head>
    <meta charset="utf-8" />
    <link rel="icon" href="./favicon.ico" />
    <meta name="viewport" content="width=device-width,initial-scale=1" />
    <meta name="theme-color" content="#000000" />
    <meta name="description" content="Web site created using create-react-app" />
    <title>React App</title>
    <script defer="defer" src="./static/js/main.b5cfc034.js"></script>
    <link href="./static/css/main.6dfd32f4.css" rel="stylesheet">
    <style>
        .css-b0j76j[aria-invalid=true],
        .css-b0j76j[data-invalid],
        .css-b41ozg[aria-invalid=true],
        .css-b41ozg[data-invalid] {
            box-shadow: none !important;
            border-color: #e7e7e7 !important;
        }

        [role="dialog"] {
            background-color: #ffe9f1 !important;
        }

        .pageContainer:after {
            content: ".";
            display: block;
            height: 0;
            overflow: hidden;
            clear: both;
        }

        .pageContainer {
            zoom: 1;
            display: inline-block;
        }

        .pageContainer li {
            list-style: none;
            float: left;
            cursor: pointer;
            padding: 0 10px;
            height: 28px;
            line-height: 28px;
            margin-right: 8px;
            text-align: center;
            border: 1px solid #e4e4e4;
            border-radius: 6px;
        }

        .pageContainer li:last-child {
            margin-right: 0px;
        }

        .pageContainer .activePage {
            color: #fff;
            background: #ff4823;
        }

        .pageContainer .nomore {
            color: #b5b5b5;
            cursor: default !important;
        }
    </style>
</head>

<body>
    <div id="root" style="height:100vh;background-color:#ffe9f1"></div>
</body>

</html>
